 {'turn id': 2, 'user utterance': 'This should go out as an intra-office memorandum to all employees by this afternoon. Are you ready?', 'system response': 'Yes, sir. Go ahead.', 'dialog history': '<USER> Ms. Dawson, I need you to take a dictation for me. <SYSTEM> Yes, sir...', 'original user side information': '{"speaker": "Person1"}', 'original system side information': '{"speaker": "Person2"}'}
