[{'turn id': 1, 'user utterance': "I've had it! I am done working for a company that is taking me nowhere!", 'system response': 'So what are you gonna do? Just quit?', 'dialog history': '', 'original user side information': '{"speaker": "Person1"}', 'original system side information': '{"speaker": "Person2"}'}
 {'turn id': 2, 'user utterance': "That's exactly what I am going to do! I have decided to create my own company! I am going to write up a business plan, get some investors and start working for myself!", 'system response': 'Have you ever written up a business plan before?', 'dialog history': "<USER> I've had it! I am done working for a company that is taking me nowhere! <SYSTEM> So what are you gonna do? Just quit?", 'original user side information': '{"speaker": "Person1"}', 'original system side information': '{"speaker": "Person2"}'}
 {'turn id': 3, 'user utterance': "Well, no, it can't be that hard! I mean, all you have to do is explain your business, how you are going to do things and that's it, right?", 'system response': "You couldn't be more wrong! A well written business plan will include an executive summary which highlights the idea of the business in two pages or less. Then you need to describe your company with information such as what type of legal structure it has, history, etc.", 'dialog history': "<USER> I've had it! I am done working for a company that is taking me nowhere! <SYSTEM> So what are you gonna do? Just quit? <USER> That's exactly what I am going to do! I have decided to create my own company! I am going to write up a business plan, get some investors and start working for myself! <SYSTEM> Have you ever written up a business plan before?", 'original user side information': '{"speaker": "Person1"}', 'original system side information': '{"speaker": "Person2"}'}
 {'turn id': 4, 'user utterance': 'Well, that seems easy enough.', 'system response': 'Wait, there is more! Then you need to introduce and describe your goods or services. What they are and how they are different from competitors? Then comes the hard part, a market analysis. You need to investigate and analyze hundreds of variables! You need to take into consideration socioeconomic factors from GDP per capita to how many children on average the population has! All this information is useful so that you can move on to your strategy and implementation stage, where you will describe in detail how you will actually execute your idea.', 'dialog history': "<USER> I've had it! I am done working for a company that is taking me nowhere! <SYSTEM> So what are you gonna do? Just quit? <USER> That's exactly what I am going to do! I have decided to create my own company! I am going to write up a business plan, get some investors and start working for myself! <SYSTEM> Have you ever written up a business plan before? <USER> Well, no, it can't be that hard! I mean, all you have to do is explain your business, how you are going to do things and that's it, right? <SYSTEM> You couldn't be more wrong! A well written business plan will include an executive summary which highlights the idea of the business in two pages or less. Then you need to describe your company with information such as what type of legal structure it has, history, etc.", 'original user side information': '{"speaker": "Person1"}', 'original system side information': '{"speaker": "Person2"}'}
 {'turn id': 5, 'user utterance': 'Geez. Is that all?', 'system response': 'Almost, the most important piece of information for your investors will be the financial analysis. Here you will calculate and estimate sales, cash flow and profits. After all, people will want to know when they will begin to see a return on their investment!', 'dialog history': "<USER> I've had it! I am done working for a company that is taking me nowhere! <SYSTEM> So what are you gonna do? Just quit? <USER> That's exactly what I am going to do! I have decided to create my own company! I am going to write up a business plan, get some investors and start working for myself! <SYSTEM> Have you ever written up a business plan before? <USER> Well, no, it can't be that hard! I mean, all you have to do is explain your business, how you are going to do things and that's it, right? <SYSTEM> You couldn't be more wrong! A well written business plan will include an executive summary which highlights the idea of the business in two pages or less. Then you need to describe your company with information such as what type of legal structure it has, history, etc. <USER> Well, that seems easy enough. <SYSTEM> Wait, there is more! Then you need to introduce and describe your goods or services. What they are and how they are different from competitors? Then comes the hard part, a market analysis. You need to investigate and analyze hundreds of variables! You need to take into consideration socioeconomic factors from GDP per capita to how many children on average the population has! All this information is useful so that you can move on to your strategy and implementation stage, where you will describe in detail how you will actually execute your idea.", 'original user side information': '{"speaker": "Person1"}', 'original system side information': '{"speaker": "Person2"}'}]

[{'turn id': 1, 'user utterance': "What's wrong with you? Why are you scratching so much?", 'system response': "I feel itchy! I can't stand it anymore! I think I may be coming down with something. I feel lightheaded and weak.", 'dialog history': '', 'original user side information': '{"speaker": "Person1"}', 'original system side information': '{"speaker": "Person2"}'}
 {'turn id': 2, 'user utterance': 'Let me have a look. Whoa! Get away from me!', 'system response': "What's wrong?", 'dialog history': "<USER> What's wrong with you? Why are you scratching so much? <SYSTEM> I feel itchy! I can't stand it anymore! I think I may be coming down with something. I feel lightheaded and weak.", 'original user side information': '{"speaker": "Person1"}', 'original system side information': '{"speaker": "Person2"}'}
