 {'turn id': 4, 'user utterance': "Well in the meantime you are a biohazard! I didn't get it when I was a kid and I've heard that you can even die if you get it as an adult!", 'system response': "Are you serious? You always blow things out of proportion. In any case, I think I'll go take an oatmeal bath.", 'dialog history': "<USER> What's wrong with you? Why are you scratching so much? <SYSTEM> I feel itchy! I can't stand it anymore! I think I may be coming down with something. I feel lightheaded and weak. <USER> Let me have a look. Whoa! Get away from me! <SYSTEM> What's wrong? <USER> I think you have chicken pox! You are contagious! Get away! Don't breathe on me! <SYSTEM> Maybe it's just a rash or an allergy! We can't be sure until I see a doctor.", 'original user side information': '{"speaker": "Person1"}', 'original system side information': '{"speaker": "Person2"}'}]

