[{'turn id': 1, 'user utterance': 'Is this the workshop to prepare for an interview?', 'system response': 'This is the interview class. Welcome to our class.', 'dialog history': '', 'original user side information': '{"speaker": "Person1"}', 'original system side information': '{"speaker": "Person2"}'}
 {'turn id': 2, 'user utterance': 'I am really excited to be taking this workshop so that I can get ready for my interview next week.', 'system response': 'We are all learning things that will help us in our interview. What do you think are some important considerations going into your interview?', 'dialog history': '<USER> Is this the workshop to prepare for an interview? <SYSTEM> This is the interview class. Welcome to our class.', 'original user side information': '{"speaker": "Person1"}', 'original system side information': '{"speaker": "Person2"}'}
