[{'turn id': 1, 'user utterance': "Don't tell me you're bored already?", 'system response': 'Well, yeah, I am.', 'dialog history': '', 'original user side information': '{"speaker": "Person1"}', 'original system side information': '{"speaker": "Person2"}'}
 {'turn id': 2, 'user utterance': 'We just got here. You will have to find a way to entertain yourself then.', 'system response': 'What can I do? There are just a bunch of boring people giving boring speeches.', 'dialog history': "<USER> Don't tell me you're bored already? <SYSTEM> Well, yeah, I am.", 'original user side information': '{"speaker": "Person1"}', 'original system side information': '{"speaker": "Person2"}'}
