 {'turn id': 4, 'user utterance': 'Yes, it would. I might have a few old newspapers in my bag. You could read them. They also have sections with games in them, like crossword puzzles. That will keep you busy for a while.', 'system response': 'I hate crosswords. Do the papers have comic sections in them?', 'dialog history': "<USER> Don't tell me you're bored already? <SYSTEM> Well, yeah, I am. <USER> We just got here. You will have to find a way to entertain yourself then. <SYSTEM> What can I do? There are just a bunch of boring people giving boring speeches. <USER> Too bad. I have to sit through it, so you do, too. Even if it's a little boring, it's important for me to be here. I have to listen carefully, take notes and then interview some of the speakers afterward. I work for the Daily News after all. Didn't you bring anything to read? <SYSTEM> I brought my iPod and some headphones. Would it be rude to listen to some music?", 'original user side information': '{"speaker": "Person1"}', 'original system side information': '{"speaker": "Person2"}'}]

[{'turn id': 1, 'user utterance': 'Have you ever thought of moving, Sarah?', 'system response': "We thought about it, but my husband and I can't afford it right now.", 'dialog history': '', 'original user side information': '{"speaker": "Person1"}', 'original system side information': '{"speaker": "Person2"}'}
 {'turn id': 2, 'user utterance': 'Buying a house near our company can be expensive, but there are ways to find cheaper houses.', 'system response': 'Like what?', 'dialog history': "<USER> Have you ever thought of moving, Sarah? <SYSTEM> We thought about it, but my husband and I can't afford it right now.", 'original user side information': '{"speaker": "Person1"}', 'original system side information': '{"speaker": "Person2"}'}
 {'turn id': 3, 'user utterance': 'Well, you can buy a house far away from the city center. You would definitely save money that way.', 'system response': "That's a good idea.", 'dialog history': "<USER> Have you ever thought of moving, Sarah? <SYSTEM> We thought about it, but my husband and I can't afford it right now. <USER> Buying a house near our company can be expensive, but there are ways to find cheaper houses. <SYSTEM> Like what?", 'original user side information': '{"speaker": "Person1"}', 'original system side information': '{"speaker": "Person2"}'}
 {'turn id': 4, 'user utterance': "My sister in law and her husband just bought a house that way. And they're pretty satisfied with it.", 'system response': 'Is the house in poor condition?', 'dialog history': "<USER> Have you ever thought of moving, Sarah? <SYSTEM> We thought about it, but my husband and I can't afford it right now. <USER> Buying a house near our company can be expensive, but there are ways to find cheaper houses. <SYSTEM> Like what? <USER> Well, you can buy a house far away from the city center. You would definitely save money that way. <SYSTEM> That's a good idea.", 'original user side information': '{"speaker": "Person1"}', 'original system side information': '{"speaker": "Person2"}'}
 {'turn id': 5, 'user utterance': 'Not at all, the woman who owned it bought it from her friend and took good care of it. But when she died she had no family left and no will, so the government had to sell it for her.', 'system response': 'Was it a very old house?', 'dialog history': "<USER> Have you ever thought of moving, Sarah? <SYSTEM> We thought about it, but my husband and I can't afford it right now. <USER> Buying a house near our company can be expensive, but there are ways to find cheaper houses. <SYSTEM> Like what? <USER> Well, you can buy a house far away from the city center. You would definitely save money that way. <SYSTEM> That's a good idea. <USER> My sister in law and her husband just bought a house that way. And they're pretty satisfied with it. <SYSTEM> Is the house in poor condition?", 'original user side information': '{"speaker": "Person1"}', 'original system side information': '{"speaker": "Person2"}'}
 {'turn id': 6, 'user utterance': "Yes, it was about 50 years old. There were a few repairs that needed doing but it didn't take a lot of money or time.", 'system response': 'Is it in a good location?', 'dialog history': "<USER> Have you ever thought of moving, Sarah? <SYSTEM> We thought about it, but my husband and I can't afford it right now. <USER> Buying a house near our company can be expensive, but there are ways to find cheaper houses. <SYSTEM> Like what? <USER> Well, you can buy a house far away from the city center. You would definitely save money that way. <SYSTEM> That's a good idea. <USER> My sister in law and her husband just bought a house that way. And they're pretty satisfied with it. <SYSTEM> Is the house in poor condition? <USER> Not at all, the woman who owned it bought it from her friend and took good care of it. But when she died she had no family left and no will, so the government had to sell it for her. <SYSTEM> Was it a very old house?", 'original user side information': '{"speaker": "Person1"}', 'original system side information': '{"speaker": "Person2"}'}]

[{'turn id': 1, 'user utterance': "Hello. Welcome to this week's People You Meet. Today, we present to you Mark Leach, an information officer in London.", 'system response': "Hi everyone, my name's Mark Leach. I'm an information officer at the Britain Business Center, which is a tourist office for the British tourist board in London. Here, we offer a tourist information service to mainly visitors from overseas. And each year, we have about 500,000 people come to the office.", 'dialog history': '', 'original user side information': '{"speaker": "Person1"}', 'original system side information': '{"speaker": "Person2"}'}
