[{'turn id': 1, 'user utterance': 'Have you ever been invited to a Chinese feast?', 'system response': 'Sure. Beijingers are distinguished for their warmth and hospitality.', 'dialog history': '', 'original user side information': '{"speaker": "Person1"}', 'original system side information': '{"speaker": "Person2"}'}
 {'turn id': 2, 'user utterance': 'As far as you could see, is dining at a Chinese table a distinct experience? To what extent does it differ from that in your homeland?', 'system response': 'To begin with, I have to use chopsticks.', 'dialog history': '<USER> Have you ever been invited to a Chinese feast? <SYSTEM> Sure. Beijingers are distinguished for their warmth and hospitality.', 'original user side information': '{"speaker": "Person1"}', 'original system side information': '{"speaker": "Person2"}'}
 {'turn id': 3, 'user utterance': 'But you look quite proficient in using them now.', 'system response': "Certainly. After all, I've been here for two years. It's not much uphill work for a foreigner to get used to Chinese dinner utensils. Though, I do feel hazy about how to behave appropriately at a Chinese table.", 'dialog history': '<USER> Have you ever been invited to a Chinese feast? <SYSTEM> Sure. Beijingers are distinguished for their warmth and hospitality. <USER> As far as you could see, is dining at a Chinese table a distinct experience? To what extent does it differ from that in your homeland? <SYSTEM> To begin with, I have to use chopsticks.', 'original user side information': '{"speaker": "Person1"}', 'original system side information': '{"speaker": "Person2"}'}
 {'turn id': 4, 'user utterance': 'Yes, table etiquette. There are a multitude of rules that foreigners might never know until they were told. Some practices even appear somewhat awkward or rude to Westerners, while they are the norm in China. Hey! Your chopsticks, old silly! You should never stab your chopsticks into the rice bowl!', 'system response': 'Anything wrong with that?', 'dialog history': "<USER> Have you ever been invited to a Chinese feast? <SYSTEM> Sure. Beijingers are distinguished for their warmth and hospitality. <USER> As far as you could see, is dining at a Chinese table a distinct experience? To what extent does it differ from that in your homeland? <SYSTEM> To begin with, I have to use chopsticks. <USER> But you look quite proficient in using them now. <SYSTEM> Certainly. After all, I've been here for two years. It's not much uphill work for a foreigner to get used to Chinese dinner utensils. Though, I do feel hazy about how to behave appropriately at a Chinese table.", 'original user side information': '{"speaker": "Person1"}', 'original system side information': '{"speaker": "Person2"}'}
 {'turn id': 5, 'user utterance': "Maybe you should have placed them horizontally over your bowl or plate. They resemble two incense sticks used at sacrifices for the death. It's very inauspicious, and might enrage all present.", 'system response': "Oh, sorry! There's a long story even with a mere pair of sticks.", 'dialog history': "<USER> Have you ever been invited to a Chinese feast? <SYSTEM> Sure. Beijingers are distinguished for their warmth and hospitality. <USER> As far as you could see, is dining at a Chinese table a distinct experience? To what extent does it differ from that in your homeland? <SYSTEM> To begin with, I have to use chopsticks. <USER> But you look quite proficient in using them now. <SYSTEM> Certainly. After all, I've been here for two years. It's not much uphill work for a foreigner to get used to Chinese dinner utensils. Though, I do feel hazy about how to behave appropriately at a Chinese table. <USER> Yes, table etiquette. There are a multitude of rules that foreigners might never know until they were told. Some practices even appear somewhat awkward or rude to Westerners, while they are the norm in China. Hey! Your chopsticks, old silly! You should never stab your chopsticks into the rice bowl! <SYSTEM> Anything wrong with that?", 'original user side information': '{"speaker": "Person1"}', 'original system side information': '{"speaker": "Person2"}'}]

