[{'turn id': 1, 'user utterance': 'Good morning, thanks for coming. Shall we begin? Why do you want to be a music teacher?', 'system response': "Because I've been always loving music since I was young. And I hope I could have a job that suits my interest.", 'dialog history': '', 'original user side information': '{"speaker": "Person1"}', 'original system side information': '{"speaker": "Person2"}'}
