[{'turn id': 1, 'user utterance': 'You look terrible, did you have a car accident?', 'system response': "Well, not exactly. This morning I went to deliver milk, and the garden gate of No. 12 was locked. There was a note on the door of the house, and I thought I couldn't read it from where I was.", 'dialog history': '', 'original user side information': '{"speaker": "Person1"}', 'original system side information': '{"speaker": "Person2"}'}
