[{'turn id': 1, 'user utterance': 'Hey there, you look a little lost. Are you new here?', 'system response': "Yeah how'd you know?", 'dialog history': '', 'original user side information': '{"speaker": "Person1"}', 'original system side information': '{"speaker": "Person2"}'}
