 {'turn id': 3, 'user utterance': "It's ok, I know how it is. This machine here will work out your upper body, mainly your triceps and biceps. Are you looking to develop strength or muscle tone and definition?", 'system response': "Well, I don't want to be ripped like you! I just want a good physique with weights and cardio.", 'dialog history': "<USER> Hey there, you look a little lost. Are you new here? <SYSTEM> Yeah how'd you know? <USER> You can always spot the newbies. I can give you a few pointers if you want. Were you trying to use this machine here? <SYSTEM> Yeah! I just started my training today and I'm not really sure where to begin.", 'original user side information': '{"speaker": "Person1"}', 'original system side information': '{"speaker": "Person2"}'}
