[{'turn id': 1, 'user utterance': 'Hey, Susan. Have you got a sec? I have some questions about my paycheck.', 'system response': 'You bet, Emily. Pull up a chair.', 'dialog history': '', 'original user side information': '{"speaker": "Person1"}', 'original system side information': '{"speaker": "Person2"}'}
 {'turn id': 2, 'user utterance': "Well, this is my first paycheck here in the States and there are a few things I don't understand. First of all, what is this FICA, and SUI Y tax, and why are there deductions both for Medicare and for my health insurance plan?", 'system response': "OK, let's start from the top of your pay stub. This number here represents your gross pay. Then here we have a series of deductions. First off are the federal ones. FICA stands for Federal Insurance Contribution Act, or something like that. It's your federal income tax. And then there's Social Security and Medicare, which are both federal programs to help you out after you retire or if you were unable to work.", 'dialog history': '<USER> Hey, Susan. Have you got a sec? I have some questions about my paycheck. <SYSTEM> You bet, Emily. Pull up a chair.', 'original user side information': '{"speaker": "Person1"}', 'original system side information': '{"speaker": "Person2"}'}
 {'turn id': 3, 'user utterance': "All right, I see. So the Medicare isn't actually a health insurance I can use now.", 'system response': "That's right. Below the federal deductions are the state deductions. There's the state income tax, and then this SUI/SDI tax you were asking about is paying into an unemployment and disability fund that our state has set up, but you can see it's a pretty small quantity that they take.", 'dialog history': "<USER> Hey, Susan. Have you got a sec? I have some questions about my paycheck. <SYSTEM> You bet, Emily. Pull up a chair. <USER> Well, this is my first paycheck here in the States and there are a few things I don't understand. First of all, what is this FICA, and SUI Y tax, and why are there deductions both for Medicare and for my health insurance plan? <SYSTEM> OK, let's start from the top of your pay stub. This number here represents your gross pay. Then here we have a series of deductions. First off are the federal ones. FICA stands for Federal Insurance Contribution Act, or something like that. It's your federal income tax. And then there's Social Security and Medicare, which are both federal programs to help you out after you retire or if you were unable to work.", 'original user side information': '{"speaker": "Person1"}', 'original system side information': '{"speaker": "Person2"}'}
 {'turn id': 4, 'user utterance': "Yeah, I don't mind giving them a dollar fifty for that. So there are two separate income taxes,one at a state level and one at a federal level?", 'system response': "That's right. Not all states have an income tax. Some use higher property taxes or sales taxes instead.", 'dialog history': "<USER> Hey, Susan. Have you got a sec? I have some questions about my paycheck. <SYSTEM> You bet, Emily. Pull up a chair. <USER> Well, this is my first paycheck here in the States and there are a few things I don't understand. First of all, what is this FICA, and SUI Y tax, and why are there deductions both for Medicare and for my health insurance plan? <SYSTEM> OK, let's start from the top of your pay stub. This number here represents your gross pay. Then here we have a series of deductions. First off are the federal ones. FICA stands for Federal Insurance Contribution Act, or something like that. It's your federal income tax. And then there's Social Security and Medicare, which are both federal programs to help you out after you retire or if you were unable to work. <USER> All right, I see. So the Medicare isn't actually a health insurance I can use now. <SYSTEM> That's right. Below the federal deductions are the state deductions. There's the state income tax, and then this SUI/SDI tax you were asking about is paying into an unemployment and disability fund that our state has set up, but you can see it's a pretty small quantity that they take.", 'original user side information': '{"speaker": "Person1"}', 'original system side information': '{"speaker": "Person2"}'}
 {'turn id': 5, 'user utterance': 'I see. All right, well I think everything else I can figure out on my own. The deductions for health insurance and my 401(K) are pretty self-explanatory. Thanks for your help, Susan.', 'system response': "No problem! All those deductions do add up, and nobody's net pay is as high as they'd like. I can understand why you'd want some explanation.", 'dialog history': "<USER> Hey, Susan. Have you got a sec? I have some questions about my paycheck. <SYSTEM> You bet, Emily. Pull up a chair. <USER> Well, this is my first paycheck here in the States and there are a few things I don't understand. First of all, what is this FICA, and SUI Y tax, and why are there deductions both for Medicare and for my health insurance plan? <SYSTEM> OK, let's start from the top of your pay stub. This number here represents your gross pay. Then here we have a series of deductions. First off are the federal ones. FICA stands for Federal Insurance Contribution Act, or something like that. It's your federal income tax. And then there's Social Security and Medicare, which are both federal programs to help you out after you retire or if you were unable to work. <USER> All right, I see. So the Medicare isn't actually a health insurance I can use now. <SYSTEM> That's right. Below the federal deductions are the state deductions. There's the state income tax, and then this SUI/SDI tax you were asking about is paying into an unemployment and disability fund that our state has set up, but you can see it's a pretty small quantity that they take. <USER> Yeah, I don't mind giving them a dollar fifty for that. So there are two separate income taxes,one at a state level and one at a federal level? <SYSTEM> That's right. Not all states have an income tax. Some use higher property taxes or sales taxes instead.", 'original user side information': '{"speaker": "Person1"}', 'original system side information': '{"speaker": "Person2"}'}]

