 {'turn id': 2, 'user utterance': 'Did you find it easy to get information?', 'system response': "Yeah, I discovered there were lots of people at my age trying to be green. I'd always gone to school by car. Catching a bus would be better, but there's no bus where we live. So I've gone for riding my bike to school now.", 'dialog history': "<USER> Tim, you're going to talk about your project and how to lead a greener life. Why did you choose that subject? <SYSTEM> Well. We'd learned a lot about the environment in our science lessons, so I decided to see what I could do in my own life rather than just act completely helpless. And I knew the rest of my family would be interested.", 'original user side information': '{"speaker": "Person1"}', 'original system side information': '{"speaker": "Person2"}'}
