 {'turn id': 4, 'user utterance': 'Well, I can tell you from experience that Bob might come off a little strong sometimes.', 'system response': "That's exactly what happened! He kept interrupting everyone with his own suggestions and did not want to hear what others had to say. Then he expected everyone to agree with him.", 'dialog history': "<USER> Hey Sarah, are you all right? You look upset. <SYSTEM> As a matter of fact, I am a bit upset. I just came out of a meeting and it didn't go very well. <USER> What happened? <SYSTEM> No one would listen to any of my suggestions. Instead, they just kept arguing with each other. <USER> Who was chairing the meeting? <SYSTEM> Bob.", 'original user side information': '{"speaker": "Person1"}', 'original system side information': '{"speaker": "Person2"}'}
