 {'turn id': 7, 'user utterance': 'You have to keep things short and sweet. When you get a chance to speak, try not to get into too many unnecessary details.', 'system response': 'Short and sweet? But what if I have to explain something complicated?', 'dialog history': "<USER> Hey Sarah, are you all right? You look upset. <SYSTEM> As a matter of fact, I am a bit upset. I just came out of a meeting and it didn't go very well. <USER> What happened? <SYSTEM> No one would listen to any of my suggestions. Instead, they just kept arguing with each other. <USER> Who was chairing the meeting? <SYSTEM> Bob. <USER> Well, I can tell you from experience that Bob might come off a little strong sometimes. <SYSTEM> That's exactly what happened! He kept interrupting everyone with his own suggestions and did not want to hear what others had to say. Then he expected everyone to agree with him. <USER> What was the meeting about? <SYSTEM> We were trying to come up with ideas to streamline the office's workflow to make it more efficient. <USER> It's ironic that the meeting was anything but efficient. <SYSTEM> Exactly. I had tons of ideas that I wanted to share, but they just wouldn't let me finish. What should I have done to get my point across?", 'original user side information': '{"speaker": "Person1"}', 'original system side information': '{"speaker": "Person2"}'}
