[{'turn id': 1, 'user utterance': 'Yes. Can I help you?', 'system response': "Yes. You see, I've bought this personal stereo at your shop 3 days ago. And I'm afraid it hasn't really matched up to what I was told about.", 'dialog history': '', 'original user side information': '{"speaker": "Person1"}', 'original system side information': '{"speaker": "Person2"}'}
