 {'turn id': 3, 'user utterance': 'But you should have noticed that when you bought it.', 'system response': 'But it was in the box and all sealed up.', 'dialog history': "<USER> Yes. Can I help you? <SYSTEM> Yes. You see, I've bought this personal stereo at your shop 3 days ago. And I'm afraid it hasn't really matched up to what I was told about. <USER> I see, what exactly is the matter? <SYSTEM> Well, first of all, there is this large scratch across the front of it.", 'original user side information': '{"speaker": "Person1"}', 'original system side information': '{"speaker": "Person2"}'}
 {'turn id': 4, 'user utterance': "Well. I'm sorry, but it really is your responsibility to check the goods when you buy them. How are we to know that it wasn't you who made the scratch?", 'system response': "But that's ridiculous. But anyway, it's not the most important thing. I really am not happy about this other thing.", 'dialog history': "<USER> Yes. Can I help you? <SYSTEM> Yes. You see, I've bought this personal stereo at your shop 3 days ago. And I'm afraid it hasn't really matched up to what I was told about. <USER> I see, what exactly is the matter? <SYSTEM> Well, first of all, there is this large scratch across the front of it. <USER> But you should have noticed that when you bought it. <SYSTEM> But it was in the box and all sealed up.", 'original user side information': '{"speaker": "Person1"}', 'original system side information': '{"speaker": "Person2"}'}
 {'turn id': 5, 'user utterance': 'And what is that?', 'system response': 'Look. It says here that the noise from it should be undetectable by other people.', 'dialog history': "<USER> Yes. Can I help you? <SYSTEM> Yes. You see, I've bought this personal stereo at your shop 3 days ago. And I'm afraid it hasn't really matched up to what I was told about. <USER> I see, what exactly is the matter? <SYSTEM> Well, first of all, there is this large scratch across the front of it. <USER> But you should have noticed that when you bought it. <SYSTEM> But it was in the box and all sealed up. <USER> Well. I'm sorry, but it really is your responsibility to check the goods when you buy them. How are we to know that it wasn't you who made the scratch? <SYSTEM> But that's ridiculous. But anyway, it's not the most important thing. I really am not happy about this other thing.", 'original user side information': '{"speaker": "Person1"}', 'original system side information': '{"speaker": "Person2"}'}
 {'turn id': 6, 'user utterance': "Yes, that's right.", 'system response': "But people can hear it, and it's really embarrassing on the bus and underground.", 'dialog history': "<USER> Yes. Can I help you? <SYSTEM> Yes. You see, I've bought this personal stereo at your shop 3 days ago. And I'm afraid it hasn't really matched up to what I was told about. <USER> I see, what exactly is the matter? <SYSTEM> Well, first of all, there is this large scratch across the front of it. <USER> But you should have noticed that when you bought it. <SYSTEM> But it was in the box and all sealed up. <USER> Well. I'm sorry, but it really is your responsibility to check the goods when you buy them. How are we to know that it wasn't you who made the scratch? <SYSTEM> But that's ridiculous. But anyway, it's not the most important thing. I really am not happy about this other thing. <USER> And what is that? <SYSTEM> Look. It says here that the noise from it should be undetectable by other people.", 'original user side information': '{"speaker": "Person1"}', 'original system side information': '{"speaker": "Person2"}'}
 {'turn id': 7, 'user utterance': "Well, I'm sorry, but it must be the way you are wearing the headphones.", 'system response': 'Look. I know how to put earphones in my ears. Thank you very much. But what I want to know is, what you are going to do about it at all?', 'dialog history': "<USER> Yes. Can I help you? <SYSTEM> Yes. You see, I've bought this personal stereo at your shop 3 days ago. And I'm afraid it hasn't really matched up to what I was told about. <USER> I see, what exactly is the matter? <SYSTEM> Well, first of all, there is this large scratch across the front of it. <USER> But you should have noticed that when you bought it. <SYSTEM> But it was in the box and all sealed up. <USER> Well. I'm sorry, but it really is your responsibility to check the goods when you buy them. How are we to know that it wasn't you who made the scratch? <SYSTEM> But that's ridiculous. But anyway, it's not the most important thing. I really am not happy about this other thing. <USER> And what is that? <SYSTEM> Look. It says here that the noise from it should be undetectable by other people. <USER> Yes, that's right. <SYSTEM> But people can hear it, and it's really embarrassing on the bus and underground.", 'original user side information': '{"speaker": "Person1"}', 'original system side information': '{"speaker": "Person2"}'}
