[{'turn id': 1, 'user utterance': "How did your company's fundraiser go?", 'system response': 'The fundraiser events went really well. We were able to partner with a few of our competitors, all in fun of course, to sponsor a marathon for the American Cancer Society. All of the people who participated it had a great time, and we were able to raise a lot of money to contribute to cancer research.', 'dialog history': '', 'original user side information': '{"speaker": "Person1"}', 'original system side information': '{"speaker": "Person2"}'}
 {'turn id': 2, 'user utterance': 'So how does it work? How were you able to make money with the marathon?', 'system response': 'Each of the runners that participated the marathon race paid a ten dollar entrance fee. Also, they went door to door to get sponsors who pledged a dollar per mile that participants ran. All in all we were able to raise several thousand dollars.', 'dialog history': "<USER> How did your company's fundraiser go? <SYSTEM> The fundraiser events went really well. We were able to partner with a few of our competitors, all in fun of course, to sponsor a marathon for the American Cancer Society. All of the people who participated it had a great time, and we were able to raise a lot of money to contribute to cancer research.", 'original user side information': '{"speaker": "Person1"}', 'original system side information': '{"speaker": "Person2"}'}
 {'turn id': 3, 'user utterance': 'Sounds like a great deal for the American Cancer Society.', 'system response': "In all honesty, it's also a great deal for our company. The exposure that we gained from sponsoring an invent like this was great for our image in the community. We accomplished as much as last year's advertising campaign, plus we were able to do a little fundraising for a good cause.", 'dialog history': "<USER> How did your company's fundraiser go? <SYSTEM> The fundraiser events went really well. We were able to partner with a few of our competitors, all in fun of course, to sponsor a marathon for the American Cancer Society. All of the people who participated it had a great time, and we were able to raise a lot of money to contribute to cancer research. <USER> So how does it work? How were you able to make money with the marathon? <SYSTEM> Each of the runners that participated the marathon race paid a ten dollar entrance fee. Also, they went door to door to get sponsors who pledged a dollar per mile that participants ran. All in all we were able to raise several thousand dollars.", 'original user side information': '{"speaker": "Person1"}', 'original system side information': '{"speaker": "Person2"}'}]

