[{'turn id': 1, 'user utterance': 'How did you get interested in country music?', 'system response': 'Well, when my wife and I first caught our record player. We started to buy all kinds of records, soon, I found that I was buying more country music records than any other kind.', 'dialog history': '', 'original user side information': '{"speaker": "Person1"}', 'original system side information': '{"speaker": "Person2"}'}
